import React from 'react';
function Books(props) {
    return(
    <li>
        <img className='books' src={props.url} alt={props.alt}/>
    </li>
    )
}

export default function Bookshelf() {
    return(
        <div>
            <div className='menu'>
                <p className='helloWorld'>내 서재</p>

                <ul className='bookStorage'>
                    <div className='bookAlign'>
                        <Books url='img/마당을 나온 암탉 표지.png' alt='마당을 나온 암탉'/>
                    </div>

                </ul>

            </div>
        </div>

    )
}
